	add("mindfuck", "{\"term\":\"mindfuck\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Compound of {{compound|lang\u003den|mind|fuck}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something that intentionally destabilizes, confuses or manipulates the mind of another person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Ska Child, David Harris, \u0027Skavoovee\u0027, p. 106\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The first four weeks of basic training were designed to be a total \u0027\u0027mindfuck\u0027\u0027. It started from the moment they stepped off the bus and were punished for not knowing how to stand at attention, even though they\u0027d never been taught\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Mick Farren, \u0027Darklost\u0027, p. 311\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It\u0027s a \u0027\u0027mindfuck\u0027\u0027. It\u0027s just lasers and shit, like the haunted house in Disneyland\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Christopher Kyle, \u0027the monogamist\u0027, p. 53\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"This is a total \u0027\u0027mindfuck\u0027\u0027. I guess you know we broke up\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027 Student Union for Peace Action, \u0027Our Generation\u0027, p. 66\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The actual naked fact of Establishment power in the person of the police was a real \u0027\u0027mindfuck\", \"priority\":9}]}, \"synonyms\":{\"list\":[{\"text\":\"brainfuck\", \"synonymQualifier\":\"VULGAR\"},{\"text\":\"headfuck\", \"synonymQualifier\":\"VULGAR\"}]}}");

	add("mindfuckery", "{\"term\":\"mindfuckery\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|mindfuck|ery|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Behaviour, material, or conditions which destabilize or confuse the mind\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, John Dougan, \u0027The Who Sell Out\u0027, Continuum (2006), ISBN 9780826417435, page 97\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As if opening the record with a jingle wasn\u0027t perverse enough, \u0027Sell Out\u0027\u0027s first track, \u0026quot;Armenia [pronounced \u0027arm and ear\u0027] City in the Sky,\u0026quot; was an equally confounding bit of \u0027\u0027mindfuckery\", \"priority\":3}]}, \"synonyms\":{}}");

	add("mindfulness", "{\"term\":\"mindfulness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|mindful|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"awarenes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"inclination to be mindful or awar\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"pay paying attention on purpose, in the present moment, and non-judgementall\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, \u0027Who, What, Why: What Is Mindfulness?\u0027, BB\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The Oxford English Dictionary \u0026quot;also notes that the term is \u0027in weakened use\u0027. It\u0027s been diluted from its origins to now encompass all manner of meditation techniques, treatments for daily stress, even ways to lose weight.\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A form of secular meditation practice with roots in Buddhist meditation\", \"priority\":6}]}, \"synonyms\":{}}");

