	add("mindscrew", "{\"term\":\"mindscrew\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|mind|screw|t2\u003dto play with; to meddle|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something that destabilizes, confuses, or manipulates a person\u0027s mind\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Jay A. Fernandez, \u0026quot;[http://www.hollywoodreporter.com/news/abrams-making-steven-spielberg-83759 Abrams making a name for himself, but it\u0027s not Steven Spielberg just yet]\u0026quot;, \u0027The Hollywood Reporter\u0027, 12 May 2009\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It\u0027s in television that Abrams, arguably more than Spielberg, has nudged the medium forward, with \u0026quot;Felicity,\u0026quot; then \u0026quot;Alias\u0026quot; and finally the \u0027\u0027mindscrew\u0027\u0027 of \u0026quot;Lost.\u0026quot\", \"priority\":3}]}, \"synonyms\":{\"list\":[{\"text\":\"brainfuck\", \"synonymQualifier\":\"VULGAR\"},{\"text\":\"headfuck\", \"synonymQualifier\":\"VULGAR\"},{\"text\":\"mindfuck\", \"synonymQualifier\":\"VULGAR\"}]}}");

