	add("miniature", "{\"term\":\"miniature\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\", \"Latin\"], \"text\":\"From the Italian \u0027miniatura\u0027 (\u0027manuscript illumination\u0027), from \u0027miniare\u0027 (\u0027to illuminate\u0027), from the Latin \u0027miniare|miniƒÅre\u0027 (\u0027to colour red\u0027), from \u0027minium\u0027 (\u0027red lead).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Greatly diminished size or form; reduced scale\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A small version of something; a model of reduced scale\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There was a \u0027\u0027miniature\u0027\u0027 of a whaling ship in a glass bottle over the mantlepiece\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A small, highly detailed painting, a portrait miniature\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The art of painting such highly detailed miniature works\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An illustration in an illuminated manuscript\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A musical composition which is short in duration\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Sacha composed a \u0027\u0027miniature\u0027\u0027 for strings as a final project at the conservatory\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A token in a game representing a unit or character\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Jack had dozens of \u0027\u0027miniatures\u0027\u0027 of Napoleonic footsoldiers painted in detailed period regalia for his wargames\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Lettering in red; rubric distinction\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A particular feature or trait\", \"priority\":12}]}, \"synonyms\":{}}");

